import Nav from 'react-bootstrap/Nav';
import './App.css'

function Navi() {
  return (
    <Nav className='Nav' defaultActiveKey="/home" as="ul">
      <Nav.Item >
        <Nav.Link  href="/home">Home</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default Navi;
